import { useState, useEffect } from 'react'
import { API_BASE_URL } from './constans/api'
import Header from './layout/Header'
import Download from './layout/Download/Download'
import Warranty from './layout/Warranty/Warranty'
import Care from './layout/Care/Care'

const App = () => {
  // const [data, setData] = useState({})

  useEffect(() => {
    fetch(API_BASE_URL)
      .then(response => {
        if (response.ok) {
          return response.json()
        }
      })
      .then(data => setData(data))
      .catch(error => console.error(error))
  }, [])

  return (
    <>    
      {data.header && (
        <Header 
          className={data.header.name}
          data={data.header}
        />
      )}
      {data.download && (
        <Download
          className={data.download.name}
          data={data.download}
        />
      )}
      {data.warranty && (
        <Warranty
          className={data.warranty.name}
          data={data.warranty}
        />
      )}
      {data.care && (
        <Care
          className={data.care.name}
          data={data.care}
        />
      )}
    </>
  )
}

export default App
